if currentValue is not None:
	selectPath = 'MES/WorkOrder/GetPassiveWorkOrderData'
	selectParams = {
		'WorkOrderId':currentValue.value
	}
	WorkOrderData = system.db.runNamedQuery(selectPath, selectParams)

	tagWritePaths = ["[.]WorkOrderData"]
	tagWriteData = [WorkOrderData]
