if currentValue.value and not previousValue.value:					
	barcode = system.tag.read("[.]../Spine Barcode").value

	if barcode:
		spineSerialNoNumber = barcode.rsplit("|", 1)[1]		
		spineSerialNoId = DataAccess.Database.GetItemSerialNoIdBySerialNumber(spineSerialNoNumber)

		if spineSerialNoId:
			moduleSerialNoData = DataAccess.Database.GetModuleSerialNoFromSpine(spineSerialNoId)

			if moduleSerialNoData:
				itemVersionId = system.tag.read("[.]ItemVersionId").value
				system.tag.writeBlocking(["[.]SerialNumberId"], [moduleSerialNoData['ItemSerialNoId']])
				system.tag.writeBlocking(["[.]SerialNumber"], [moduleSerialNoData['SerialNoNumber']])

				# check that the item version matches this work order
				valid = MES.MEOL.Validation.CheckModuleSeries(itemVersionId, moduleSerialNoData['ItemSerialNoId'])

				if valid:					
					workOrderId  = system.tag.read("[.]WorkOrderId").value
					fromAssetId  = system.tag.read("[.]PreviousAssetId").value
					toAssetId    = system.tag.read("[.]AssetId").value
					itemReasonId = system.tag.read("[.]ItemReasonId").value

					# create item transfer into this location
					resultId = MES.MEOL.Validation.TransferModule(itemVersionId, workOrderId, moduleSerialNoData['ItemSerialNoId'], fromAssetId, toAssetId, itemReasonId, "System")

					# get asset name to check if we're in a testing bay	
					assetName = system.tag.read("[.]AssetName").value

					# if in testing bay, create test event	
					if assetName in ['TestBay-1','TestBay-2','TestBay-3','TestBay-4']:			
						eventIds = MES.MEOL.Testing.CreateTestEvent(itemVersionId, moduleSerialNoData['ItemSerialNoId'], toAssetId, itemReasonId, "System")

					system.tag.writeBlocking("[.]../Outputs/ReceivedSentMessage", [True])
				else:
					DataAccess.Log.LogError("Module series does not match running work order", functionName = "ModulePosition/ReadyToSend", application = "MEOL", user = "MES")
			else:
				DataAccess.Log.LogError("Failed to retrieve module serial data", functionName = "ModulePosition/ReadyToSend", application = "MEOL", user = "MES")
		else:
			DataAccess.Log.LogError("Failed to translate spine serial number to id", functionName = "ModulePosition/ReadyToSend", application = "MEOL", user = "MES")
	else:
		DataAccess.Log.LogError("Failed to retrieve spine barcode", functionName = "ModulePosition/ReadyToSend", application = "MEOL", user = "MES")			

